import React from 'react';

function MultiDiv() {
    return (
        <div class="row">
            <div class="row-5">
            <div class="col-9">.col-9</div><br/>
            </div>
            <div class="row-3">
                <div class="col-4">.col-4<br/>Since 9 + 4 = 13 &gt; 12, this 4-column-wide div gets wrapped onto a new line as one contiguous unit.</div><br/>
            <div class="col-6">.col-6<br/>Subsequent columns continue along the new line.</div><br/>
        </div>
        </div>
                ) }
export default MultiDiv;
